script: |
  super -f text -I q13031.spq | sort > q13031.out

inputs:
  - name: q13031.spq
    data: |
      SELECT DISTINCT + 26 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 IN ( - - col1 * + ( - - ( - - col0 ) ) + 10 + col0 );
  - name: tab1

outputs:
  - name: q13031.out
    data: |
      26
